import React from "react";
import { Link } from "react-router-dom";

const Navbar = () => {


    return (
        <nav className="navbar">
            <h1>
                <Link to="/">EmotiChat</Link>
            </h1>
            <div>
                <h3>
                    <Link to="/login">Sign In</Link>
                </h3>
                
            </div>

        </nav>
    );
};

export default Navbar;
